INSERT INTO `research` (`res_id`, `res_img`, `res_header`, `res_text`) VALUES
(1, , 'CLA, CET Graduate Programs undergo AACCUP Prelim Survey ', 'The Accrediting Agency of Chartered Colleges and Universities of the Philippines (AACCUP) conducted a Preliminary Survey Visit on three graduate programs of WMSU, three of which are from the College of Engineering and Technology (CET) and one from the College of Liberal Arts (CLA), last May 8-10, 2017.\n\nThe programs that were evaluated were: Master of Engineering Education, Master of Science in Structural Engineering, Master of Science in Environmental Engineering, and Master of Arts in English Language Studies. These programs were evaluated by the accreditors from different state universities and colleges headed by Dr. Perla P. Pasaol as Overall Coordinator. The three other accreditors were Dr. Jaimelyn L. Ututalum, Prof. Analiza S. Macacua, and Prof. Elena O. Biado.\n\nDr. Milabel Enriquez-Ho, WMSU President, acknowledged the efforts of the AACCUP Accreditation Team as a partner of the university in accrediting its curricular programs. Id like to thank the competent accreditors who believe in excellence, who fought and braved the storm and came to WMSU, said Dr. Ho. She mentioned that accreditation and certification form part of the vital partnership among the 10-member ASEAN nations. The world is going global. We have created in our ASEAN region a particular lane for all of our 10-member nations to be recognized and that standard in this membership shall be at par with one another, the president said.\n\nWe have established an ASEAN identity which marks a very great footprint in the history of the world that all of the ASEAN nations has come to terms that whether it is in education, economics, politics or opportunity between and among nations, we shall have a common framework of references, said Dr. Ho. It is vital for state universities and colleges to have a better picture of the entire higher education accreditation activity, which does not only mark and benchmark those of the country, also those of the international market particularly of the ASEAN, she furthered. This will be a start of a hybrid of higher education accreditation activity between and among countries outside the ASEAN.\n\nThe exit conference, on the other hand, held on May 10, 2017, where comments were provided by the evaluators on the strengths of the programs and recommendations for improvement. The entire activity was undertaken in compliance with the universitys goal of pursuing the highest level of standard for all curricular programs. The results of the first survey visit shall be formally transmitted in 2-3 months time after a final review by the International Network for Quality Assurance Agencies in Higher Education (INQAAHE) and the AACCUP Board of Directors.\n\nAccreditation is a tedious process, by which a tertiary level institution evaluates its educational activities to determine whether its curricular program offerings substantially achieve its objectives and is at par with the performances of other reputable universities. (Liezel M. Parreo, WMSU-PAO)\n');
INSERT INTO `research` (`res_id`, `res_img`, `res_header`, `res_text`) VALUES
(6, , 'University Librarian and Staff spearhead MASTSLiNet Seminar and General Assembly ', 'The WMSU Library headed by the University Librarian Dr. Benhur A. Asid and his staff spearheaded the MASTSLiNet Seminar-Workshop and General Assembly last May 24-26, 2017 at the Grand Astoria Hotel, this city. The seminar banners the theme: Laying the Foundations for Change: the Internationalization of State Libraries in the Academe in Mindanao.\r\n\r\nMASTSLiNet, which stands for Mindanao Association of State Tertiary Schools Library Network, is a library networking and a resource-sharing group among members of Mindanao Association of Tertiary Schools (MASTS).\r\n\r\nThe three-day event was attended by more than 50 participants from various State Universities and Colleges (SUCs) in Mindanao. Several topics were discussed, to include: ISO Requirements and Documentation, The Choreography of Qualitative Research Design, and the MASTSLiNet Journal: Basics of Writing Styles and Formats for International Publications. The discussion enabled the participants to craft research topics for MASTSLiNet Publication and know more about documenting procedures on ISO when it comes to library practices.\r\n\r\nDr. Reynante E. Autida, Director for Research Development and Evaluation Center (RDEC) also served as a resource speaker. He lectured on Integrating Quantitative Methodologies in Research.\r\n\r\nDuring the general assembly, Dr. Benhur A. Asid was elected president of MASTSLiNet. He will serve from 2017-2019. ');
